import './App.css';
import Employee from './components/Employee';

function App() {
  let role = "dev";
  const showEmployees = true;
  return (
    <div className="App">
      {showEmployees ?
        <>
          <input type="text"
            onChange={(e) => {
              console.log(e.target.value);
              role = e.target.value;
            }}
          />
          <Employee name="Caleb" role="Intern" />
          <Employee name="John" role={role} />
          <Employee name="Maeve" />
        </>
        :
        <p>You cannot see the employees.</p>
      }
    </div>
  );
}

export default App;
